// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

//import "@openzeppelin/contracts/utils/Strings.sol";


contract AircraftMaintenanceHistory {

    uint256 private recordIdCounter = 0;

    //     
    struct MaintenanceRecord {
        uint256 id;
        //  ,  ID,  ,   
        //  JSON    .
        string contents; 
    }

    //     ( )
    address[] public admins;
    mapping(uint256 => MaintenanceRecord) public maintenanceRecords;

    //      
    event RecordSaved(uint256 recordId);

    // :      .
    constructor(address[] memory _admins) {
        setAdmins(_admins);
    }

    //       
    modifier onlyAdmin() {
        require(isAdmin(msg.sender), "Only admin can call this function");
        _;
    }

    // ---    (  ) ---
    function isAdmin(address addr) private view returns (bool) {
        for (uint256 i = 0; i < admins.length; i++) {
            if (admins[i] == addr) {
                return true;
            }
        }
        return false;
    }

    function setAdmins(address[] memory _admins) private {
        require(_admins.length > 0, "At least one admin address is required");
        admins = _admins;
    }

    // ---  :    ---
    //      .
    function recordMaintenance(MaintenanceRecord[] memory _records) public onlyAdmin {
        for (uint i = 0; i < _records.length; i++) {
            MaintenanceRecord memory record = _records[i];
            uint256 id = record.id;

            if (id == 0) {
                recordIdCounter++; 
                // []    id .
                id = recordIdCounter; 
            }

            //     .
            maintenanceRecords[id] = MaintenanceRecord(id, record.contents);
            emit RecordSaved(id);
        }
    }

    // ---  :    ---
    function getMaintenanceRecord(uint256 id) public view returns (MaintenanceRecord memory) {
        MaintenanceRecord memory record = maintenanceRecords[id];
        require(record.id != 0, "Record does not exist");
        return record;
    }
}
